import React, {useEffect, useState } from 'react'
import { Paper, makeStyles, TableBody, TableRow, TableCell, Toolbar, InputAdornment } from '@material-ui/core';
import * as feeService from "../../../services/feeService";
import Controls from "../../../components/controls/Controls";
import { Search } from "@material-ui/icons";
import AddIcon from '@material-ui/icons/Add';
import Popup from "../../../components/Popup";
import EditOutlinedIcon from '@material-ui/icons/EditOutlined';
import SideMenu from '../../../components/SideMenu';
import Header from '../../../components/Header';
import FeeForm from './FeeForm';
import useTableF from '../../../components/useTableF';

const useStyles = makeStyles(theme => ({
    pageContent: {
        margin: theme.spacing(1),
        padding: theme.spacing(1)
    },
    searchInput: {
        width: '60%'
    },
    newButton: {
        position: 'absolute',
        right: '10px'
    }
}))


const headCells = [
    { id: 'montant_max', label: 'Quantia Max' },
    { id: 'montant_min', label: 'Quantia Min' },
    { id: 'fee', label: 'Taxa' },
    { id: 'date_input', label: 'Data Inicio' },
    { id: 'date_output', label: 'Data Final'},
    { id: 'actions', label: 'Estoque', disableSorting: true }
]

export default function Fees() {

    const classes = useStyles();
    const [recordForEdit, setRecordForEdit] = useState(null)
    const [records, setRecords] = useState([]);

    const getAll = () => {
        feeService.getAllFee()
        .then((res) => {
            setRecords(res.data)
        });
    }

    useEffect(() => {
        getAll();
    }, []);

    const [filterFn, setFilterFn] = useState({ fn: records => { return records; } })
    const [openPopup, setOpenPopup] = useState(false)
    // const [notify, setNotify] = useState({ isOpen: false, message: '', type: '' })
    // const [confirmDialog, setConfirmDialog] = useState({ isOpen: false, title: '', subTitle: '' })

    const {
        TblContainer,
        TblHead,
        TblPagination,
        recordsAfterPagingAndSorting
    } = useTableF(records, headCells, filterFn);

    const handleSearch = e => {
        let target = e.target;
        setFilterFn({
            fn: records => {
                if (target.value === "")
                    return records;
                else
                    return records.filter(x => x.montant_max.toLowerCase().includes(target.value))
            }
        })
    }

    const addOrEdit = (fe, resetForm) => {
        feeService.insertFee(fe);
        resetForm()
        setRecordForEdit(null)
        setOpenPopup(false)
        getAll()
    }

    const openInPopup = fe => {
        setRecordForEdit(fe)
        setOpenPopup(true)
    }

    return (
        <>
            <SideMenu />
            <Header />
            <Paper className={classes.pageContent}>
                <Toolbar>
                    <Controls.Input
                        label="Pesquisar Taxa"
                        className={classes.searchInput}
                        InputProps={{
                            startAdornment: (<InputAdornment position="start">
                                <Search />
                            </InputAdornment>)
                        }}
                        onChange={handleSearch}
                    />
                    <Controls.Button
                        text="Adicionar"
                        variant="outlined"
                        startIcon={<AddIcon />}
                        className={classes.newButton}
                        onClick={() => { setOpenPopup(true); setRecordForEdit(null); }}
                    />
                </Toolbar>
                <TblContainer>
                    <TblHead />
                    <TableBody>
                        {
                            recordsAfterPagingAndSorting().map(fe =>
                                (<TableRow key={fe.id}>
                                    <TableCell>{fe.montant_max}</TableCell>
                                    <TableCell>{fe.montant_min}</TableCell>
                                    <TableCell>{fe.fee}</TableCell>
                                    <TableCell>{fe.statut}</TableCell>
                                    <TableCell>
                                        <Controls.ActionButton
                                            color="primary"
                                            onClick={() => { openInPopup(fe) }}>
                                            <EditOutlinedIcon fontSize="small" />
                                        </Controls.ActionButton>
                                    </TableCell>
                                </TableRow>)
                            )
                        }
                    </TableBody>
                </TblContainer>
                <TblPagination />
            </Paper>
            <Popup
                title="Taxa Formato"
                openPopup={openPopup}
                setOpenPopup={setOpenPopup}
            >
                <FeeForm
                    recordForEdit={recordForEdit}
                    addOrEdit={addOrEdit} />
            </Popup>
        </>
    )
}
